import React from 'react';
import { Route } from 'react-router-dom';
import LandingPage from './LandingPage';

class App extends React.Component {
  render() {
    return (
      <main className='App'>
        <Route exact path="/" component={LandingPage}/>

      </main>
    );

  }

}

export default App;
